(13, 17, 2, 5, 2, NULL, 'Se formó un precipitado gelatinoso blanco-azul, indicando la presencia de cloruros', NULL, '2021-11-25 00:51:30', '2021-11-25 00:51:30'),
(14, 19, 2, 5, 2, NULL, 'Corroboración de presencia de carbonatos por efervescencia al contacto con el ácido', NULL, '2021-11-25 19:39:24', '2021-11-25 19:39:24'),
(15, 20, 2, 5, 2, 1, 'Formación de precipitado azul tras la reacción de los reactivos con la muestra', NULL, '2021-11-25 19:59:15', '2021-11-25 19:59:15'),
(17, 22, 3, 7, 2, 2, 'Elemento\nCu    PPM 770 K  +/- (*3) 4707\nSiO2 PPM 15 K   +/- (*3) 1005  Presencia de aluminosilicatos/posiblemente suelo arcilloso\nNi  PPM 1564  K +/- (*3)  324\nCl  PPM  5463 K   +/- (*3) 232  Positivo a cloruros\nS  PPM   3227 K  +/- (*3) 175\nP  PPM  1145', NULL, '2021-11-28 03:52:18', '2021-12-01 07:02:20'),
(19, 23, 3, 7, 2, 2, 'Aleación de Cobre, plata y estaño\nCu 71.87%\nAg 24.65%\nSn 3.20 %', NULL, '2021-11-28 04:27:23', '2021-12-01 05:51:55'),
(20, 25, 2, 5, 2, 1, 'se pudo determinar las sales presentes sobre cascabel', NULL, '2021-11-28 13:17:11', '2021-11-28 13:17:11'),
(21, 26, 1, 1, 1, 1, 'Al observar la imagen a 100x en el microscopio óptico, fue evidente la torsión característica de la fibra de algodón, todas las fibras presentaban la misma morfología', NULL, '2021-11-28 18:01:29', '2021-11-28 18:01:29'),
(22, 27, 2, 5, 2, NULL, 'Hubo reacción de efervescencia, lo que indica la presencia de carbonatos. En el caso de la muestra para cloruros, no se presentó ninguna reacción.', NULL, '2021-11-28 18:14:47', '2021-11-28 18:14:47'),
(23, 28, 2, 5, 2, NULL, 'Hubo reacción de efervescencia, lo que indica la presencia de carbonatos. En el caso de la muestra para cloruros, no se presentó ninguna reacción.', NULL, '2021-11-28 18:19:23', '2021-11-28 18:19:23'),
(24, 36, 3, 7, 2, 4, 'Los resultados que arrojó la técnica FRX describen la presencia de:\n-Cobre: 88% \n-Hierro: 11%\n-Otros: 1%', NULL, '2021-11-30 03:27:09', '2021-12-02 17:58:09'),
(26, 38, 2, 5, 2, NULL, 'Al emplear una gota de ácido clorhídrico concentrado a la muestra, mostró un breve burbujeo, lo que demuestra la presencia de carbonatos.', NULL, '2021-11-30 03:55:28', '2021-11-30 03:55:28'),
(27, 39, 2, 5, 2, NULL, 'Al agregar una gota de Ácido nítrico al 15% y después una gota de Nitrato de plata al 5% se formó un precipitado blanquecino que ennegreció con la luz, lo que determinó la presencia de cloruros.', NULL, '2021-11-30 04:01:08', '2021-11-30 04:01:08'),
(28, 40, 1, 1, 1, 1, 'Las torceduras en S y la birrefringencia en luz polarizada indican la presencia de un textil de algodón', NULL, '2021-11-30 04:43:45', '2021-11-30 04:43:45'),
(29, 41, 3, 7, 2, 4, 'El análisis elemental por FRX mostró los siguientes resultados: \n-Cobre: 1000k (100) ppm.  Lo que indica la aleación de cobre que se tiene. \n-Silicio (SiO2): 20k (2-09) ppm. Lo que indica la presencia de aluminosilicatos.', NULL, '2021-11-30 05:10:02', '2021-11-30 05:10:02'),
(31, 43, 2, 5, 2, NULL, 'Al añadir una gota de ácido nítrico se notó una leve efevesencia lo que indica la presencia de carbonatos y, al añadir el nitrato de plata al 5%, se notó el precipitado blanquecino, característico de las sales de cloro.', NULL, '2021-11-30 05:18:16', '2021-11-30 05:18:16'),
(32, 44, 3, 7, 2, 4, 'El análisis con FRX mostró los siguientes resultados:\nCobre: 64%\nEstaño: 33%\nOtros: 3%', NULL, '2021-11-30 05:24:43', '2021-12-02 07:34:20'),
(33, 45, 9, 21, 1, 4, 'La radiografía permitió observar el nivel de corrosión y el estado de conservación del objeto, mostrando un nivel de metal sano adecuado y una zonas radiodensas con mejor densidad de lo esperado para las zonas de grieta y pérdida de elementos.', NULL, '2021-11-30 05:27:42', '2021-11-30 05:27:42'),
(34, 46, 2, 5, 2, NULL, 'Al agregar una gota de ácido nítrico se notó una efervesencia de la muestra indicando carbonatos. Al agregar la otra gota de nitrato de plata se notó la presencia de cloruros', NULL, '2021-11-30 05:37:07', '2021-11-30 05:37:07'),
(35, 47, 2, 5, 2, NULL, 'Al agregar una gota de ácido clorhídrico y cloruro de bario se deó secar la muestra, al cristalizar, las sales formaron una especie de agujas, indicando la presencia de sulfatos insolubles.', NULL, '2021-11-30 05:41:14', '2021-11-30 05:41:14'),
(36, 48, 3, 7, 2, 2, 'Aleación de Cobre, plata y estaño\nCu 48.24 %\nAg 45.39%\nSn 5.96', NULL, '2021-12-01 05:33:01', '2021-12-01 05:33:01'),
(37, 49, 3, 7, 2, 2, 'Aleación de Cobre, plata y estaño\nCu 35.80%\nAg 56.55%\nSn 7.28', NULL, '2021-12-01 05:37:06', '2021-12-01 05:37:06'),
