(71, 59, 9, 21, 2, 4, 'La matriz metálica se observó con un radio-opacidad muy uniforme, sin aparentes interrupciones o zonas diferencial, por lo la pieza presenta un estado de conservación estable', NULL, '2021-12-02 00:49:51', '2021-12-02 00:49:51'),
(72, 85, 3, 7, 2, 2, 'Se observó una cantidad de elementos alcalinos y alcalino térreos, además de azufre y fosfato, por lo que se concluyó que había contaminación por concreciones de tierra, por tal motivo no se pudo hacer un muestreo elemental que ayudará a definir adecuadam', NULL, '2021-12-02 02:15:56', '2021-12-02 04:40:25'),
