(75, 87, 9, 21, 7, 4, 'Se determinó que la matriz metálica no esta sana del todo, se pueden visualizar algunas fisuras en el sector A, esto se debe probablemente al proceso de delaminación por la corrosión, la visualización con la fotografía de RX lo deja evidente, pero aparte', NULL, '2021-12-02 04:20:43', '2021-12-02 04:21:10'),
(76, 88, 3, 7, 7, 2, 'Se determinó la composición (elemental), es importante para reconocer  la presencia alta de Cu y en mucho menor medida  de Sn,  podemos hablar de un aleación de bronce, pero debido a la cantidad tan insignificante de estaño, muy posiblemente se trate de m', NULL, '2021-12-02 04:47:10', '2021-12-02 04:48:35'),
