(78, 90, 2, 5, 2, NULL, 'Se aplicó dos gotas de ácido nítrico (2N) a la muestra y posteriormente una gota de nitrato de plata al 2%, con la revisión en el microscopio  se determinó el efecto de de un precipitado blanco con una ligero matiz azulado por tal motivo concluimos que se', NULL, '2021-12-02 04:59:47', '2021-12-02 05:07:38'),
