(16, 69, 4, 1, 14, 66, 66, 14, NULL, NULL, NULL, 'Aprobado', '2021-12-06 12:26:25', NULL, NULL, NULL, '2021-10-27', 'Reverso, cuadrante superior derecho', 'Hilo de color amarillo paja, con torsión de fibras en  \"S\"', NULL, 'Fibra de color amarillo paja, aproximadamente 3 mm de espesor. Se define que es algodón por presentar cintas planas de forma retorcida/ convolución.', '2021-11-24 23:11:35', '2021-12-06 18:26:25'),
(17, 70, 1, 15, 14, 66, 66, 14, NULL, NULL, NULL, 'Aprobado', '2021-12-07 13:04:34', NULL, NULL, NULL, '2021-10-27', 'Anverso, cuadrante superior derecho', 'Puntos terrosos de color verde pastoso, muestra compacta y opaca', NULL, 'La muestra física presentaba puntos terrosos de color verde pastoso, compacta y opaca, al agregar los reactivos se obtuvo  un precipitado gelatinoso blanco-azul, indicando la presencia de cloruros.', '2021-11-25 00:02:12', '2021-12-07 19:04:34'),
(18, 71, 1, 15, 14, 66, 66, 14, NULL, NULL, NULL, 'Aprobado', '2021-12-07 13:04:56', NULL, NULL, NULL, '2021-10-27', 'Anverso, cuadrante superior izquierdo', 'Puntos terrosos de color amarillo pálido, compacta y opaca.', NULL, 'La muestra es de color amarillo pálido, se presenta como puntos terrosos, compactos y opacos. Al agregar el reactivo se observa la formación de  pequeñas agujas, indicando la presencia de sulfatos.', '2021-11-25 00:30:43', '2021-12-07 19:04:56'),
(19, 140, 1, 15, 14, 73, 73, 14, NULL, NULL, NULL, 'Aprobado', '2021-12-07 13:05:14', NULL, NULL, NULL, '2021-10-27', 'Reverso de la pieza metálica, cuadrante inferior derecho', 'Concreción terrosa de color blanco al reverso de la pieza', NULL, 'Se tomo la muestra por raspado de la concreción blanca terrosa, colocándola sobre el porta objetos, posteriormente se coloco una gota de acido clorhídrico al 10% bajo el microscopio eferveciendo por la reacción entre el acido y los carbonatos presentes en', '2021-11-25 19:32:05', '2021-12-07 19:05:14'),
(20, 141, 1, 14, 14, 73, 73, 14, NULL, NULL, NULL, 'Aprobado', '2021-12-07 13:05:57', NULL, NULL, NULL, '2021-10-27', 'Reverso de la pieza metálica, cuadrante superior derecho', 'Concreción terrosa blanquecina al reverso de la pieza', NULL, 'Se tomo muestra por raspado, colocando la muestra en porta objetos, sobre la cual se colocaron los reactivos, comprobando la presencia de nitratos por la formación de precipitado azul', '2021-11-25 19:52:16', '2021-12-07 19:05:57'),
(22, 165, 10, 15, 14, 66, 66, 14, NULL, NULL, NULL, 'Aprobado', '2021-12-06 12:25:42', NULL, NULL, NULL, '2021-11-09', 'Anverso, cuadrantes superior derecho', 'Puntos terrosos de color verde pastoso, muestra compacta y opaca', NULL, 'Puntos terrosos color verde pastoso, resultado del examen: Cl  PPM  5463 K   +/- (*3) 232  Positivo a cloruros', '2021-11-28 03:42:56', '2021-12-06 18:25:42'),
