INSERT INTO `obras__solicitudes_analisis_muestras` (`id`, `solicitud_analisis_id`, `usuario_creo_id`, `tipo_analisis_id`, `no_muestra`, `nomenclatura`, `informacion_requerida`, `motivo`, `descripcion_muestra`, `ubicacion`, `created_at`, `updated_at`) VALUES
(19, 13, 69, 15, '01', 'XV-01 CAA-093', 'Densidad de sustratos por radiografía de RX', 'Para conocer acerca de su técnica de factura, nivel de corrosión y porcentaje metálico', 'Cascabel cuniforme', 'Pieza completa', '2021-10-24 22:48:44', '2021-10-26 01:38:42'),
(20, 17, 81, 1, '1', 'I-01-CAA-100', 'Conocer a los elementos que conforman a la matriz del cascabel  por medio de un análisis con equipo de FRX', 'Para saber el tipo de tratamientos adecuados para los elementos que lo conforman', 'Polvo color rojo oscuro, textura heterogénea', 'Anverso, en el faltante inferior central', '2021-10-24 23:32:26', '2021-10-25 21:30:38'),
(21, 17, 81, 12, '1', 'XII-01-CAA-100', 'Identificar cuprita, óxido de cobre, por medio de FTIR', 'Para poder decidir si se realizará la limpieza y que tipo será mejor para el objeto', 'Polvo, color rojo/negro', 'Anverso, lado superior derecho', '2021-10-24 23:37:58', '2021-10-25 21:31:52'),
(22, 17, 81, 12, '2', 'XII-02-CAA-100', 'Identificar geraldita, sulfatos, por análisis a la gota', 'Para poder determinar si se hará limpieza y que tipo de limpieza será mejor para el objeto', 'Raspado', 'Anverso, inferior lado derecho', '2021-10-24 23:40:21', '2021-10-25 21:32:08'),
(23, 17, 81, 12, '3', 'XII-03-CAA-100', 'Identificar cloruros, por análisis a la gota', 'Para determinar si se debe de realizar desalinización del objeto', 'Polvo, color verde claro', 'Anverso, superior lado derecho', '2021-10-24 23:41:57', '2021-10-25 21:32:29'),
(24, 17, 81, 11, '1', 'XI-01-CAA-100', 'Identificar el tipo de fibra que esta presente en el objeto', 'Para conocer el tipo de fibra que se puede relacionar al uso de los cascabeles', 'Fibra', 'Reverso, superior, debajo del asa de suspensión', '2021-10-24 23:45:13', '2021-10-26 16:56:52'),
(25, 18, 80, 12, '01', 'XII-01 CAA-099', 'Identificar la presencia de Carbonatos en el material de corrosión del metal.', 'Para determinar con que método de limpieza se retirará y que ion esta afectando en mayor medida la superficie del metal.', 'Concreción verdosa', 'Cuadrante C, vista frontal', '2021-10-24 23:46:46', '2021-10-26 16:41:43'),
(26, 18, 80, 12, '02', 'XII-02 CAA-099', 'Determinar si existen Nitratos presentes en la corrosión de la superficie metálica', 'Identificar el ion que más está afectando la superficie del metal y el método de su remoción', 'concesión activa color verdosa-azul', 'Cuadrante A, vista frontal', '2021-10-24 23:49:37', '2021-10-26 16:42:05'),
(27, 18, 80, 12, '03', 'XII-03 CAA-099', 'Determinar los iones Cloruro presentes en la corrosión de la superficie metálica', 'para identificar que ion esta afectando mayormente la superficie, y evitar un mayor deterioro y formación de HCl. Identificar también el método de remoción después de identificado el ion.', 'concreción verde azulada', 'Cuadrante D, vista frontal', '2021-10-24 23:52:19', '2021-10-26 16:42:30'),
(30, 17, 81, 12, '4', 'XII-04-CAA-100', 'Identificar carbonatos, malaquita, por análisis a la gota', 'Para conocer el tipo de corrosión', 'Polvo, color verde', 'Anverso, superior lado derecho', '2021-10-25 00:10:22', '2021-10-25 21:32:49'),
(31, 22, 81, 12, '2', 'XII-02-CAA-11/15', 'Identificar carbonatos, malaquita, con FTIR', 'Para poder determinar la limpieza que se podrá realizar al objeto', 'Polvo cristalino, color verde oscuro', 'Anverso, superior lado derecho', '2021-10-25 00:15:01', '2021-10-25 21:33:40'),
(32, 22, 81, 12, '3', 'XII-03-CAA-11/15', 'Identificación de sulfatos, geraldita, con análisis a la gota', 'Para determinar el tipo de limpieza', 'Polvo cristalino, color amarillo', 'Anverso, en la apertura de la caja de resonancia', '2021-10-25 00:17:39', '2021-10-25 21:34:01'),
(33, 22, 81, 12, '4', 'XII-04-CAA-11/15', 'Identificación de cloruros, con análisis a la gota', 'Para determinar si será necesaria la desalinización de los objetos', 'Polvo cristalino, color verde claro', 'Anverso, superior', '2021-10-25 00:20:24', '2021-10-25 21:34:15'),
